import React, { Component } from "react";

class Hotline extends Component {
  render() {
    return (
      <div className="hotline-phone-ring-wrap">
        <div className="hotline-phone-ring">
          <div className="hotline-phone-ring-circle" />
          <div className="hotline-phone-ring-circle-fill" />
          <div className="hotline-phone-ring-img-circle">
            <a href="tel:0987654321" className="pps-btn-img">
              <img
                src="https://nguyenhung.net/wp-content/uploads/2019/05/icon-call-nh.png"
                alt="Gọi điện thoại"
                width={50}
              />
            </a>
          </div>
        </div>
        <div className="hotline-bar">
          <a href="tel:0987654321">
            <span className="text-hotline">0775600351</span>
          </a>
        </div>
      </div>
    );
  }
}
export default Hotline;
